%[text] # **Annulus Chart Examples**
%[text] %[text:anchor:H_9C235D8A] **Overview**
%[text] The `AnnulusChart` comprises a ring, or annulus, divided into separate sections. There is one section for each element of the chart data (a nonempty numeric vector of positive values). Each section shows the contribution of the corresponding data value to the entire data set. The volume of each section is proportional to the contribution of the specific data value to the sum of the data values.
%[text] The wedges comprising the chart can be individually exploded programmatically or via user interaction. Clicking on a wedge once will explode it radially outwards. Clicking on the same wedge a second time will restore its original position.
%[text] ![AnnulusChart.svg](text:image:3fc4)
%[text] **Documentation**
%[text] - [`surface`](<matlab: doc("surface")>): Primitive surface plot
%[text] - [`patch`](<matlab: doc("patch")>): Plot one or more filled polygonal regions \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_A772A408] ## Define the chart data.
%[text] The chart data comprises a nonempty numeric vector of positive values. For example, let's take a random permutation of the integers from 1 to 10.
rng( "default" )
data = randperm( 10 );
%[text] The chart accepts the vector data either as a row or a column, but it is stored within the chart as a column vector.
%%
%[text] %[text:anchor:H_8915F9A5] ## Create a figure for the chart.
f = exampleFigure( "Name", "AnnulusChart Example" ); %[output:6924b049]
%%
%[text] %[text:anchor:H_CEA02253] ## Create the chart.
%[text] Next, create the chart object, specifying the `Parent` and `Data` properties, and hiding the chart controls to begin with. Use a standard colormap for the wedge face colors.
AC = AnnulusChart( "Parent", f, ...     %[output:group:55b0417b] %[output:6924b049]
    "Data", data, ... %[output:6924b049]
    "FaceColor", hsv( numel( data ) ), ... %[output:6924b049]
    "Controls", "off" ); %[output:group:55b0417b] %[output:6924b049]
%[text] The resulting chart has default wedge labels and legend entries of the form "`Data k`", where `k` is the corresponding data index.
%%
%[text] %[text:anchor:H_E7E2C5AD] ## Annotate the chart.
%[text] The `Annulus` chart is equipped with the **`title`** method for annotation.
title( AC, "Annulus Chart", "FontSize", 16 ) %[output:65d0230b]
%%
%[text] %[text:anchor:H_01A752D1] ## Change the wedge label text.
%[text] Specify some new text to use for labelling the wedges.
AC.LabelText = "Wedge " + (1:numel( data )); %[output:39477d79]
%%
%[text] %[text:anchor:H_F0925564] ## Customize the legend and label appearance.
%[text] The legend currently obscures some of the wedge labels, so change its number of columns.
AC.LegendNumColumns = 2; %[output:025c2e6b]
%[text] We also adjust the legend text, title, and color properties.
AC.LegendText = string( 1:numel( data ) ); %[output:025c2e6b]
AC.LegendTitle = "Percentage contributions"; %[output:025c2e6b]
AC.LegendColor = "none"; %[output:025c2e6b]
%[text] Modify the percentage display in the wedge labels and legend.
AC.LegendPercentages = "on"; %[output:025c2e6b]
AC.LabelPercentages = "off"; %[output:025c2e6b]
%%
%[text] %[text:anchor:H_0F972773] ## Modify the chart data.
%[text] The chart data can be modified by setting the `Data` property to a new value.
AC.Data = AC.Data(1:5); %[output:4e1403dc]
AC.FaceColor = parula( numel( AC.Data ) ); %[output:4e1403dc]
%%
%[text] %[text:anchor:H_03344114] ## Define a new data vector.
%[text] The previous example set the chart data to another vector of shorter length than the original. We can also change the chart data without changing its length.
AC.Data = 1 : numel( AC.Data ); %[output:81b446ad]
AC.FaceColor = cool( numel( AC.Data ) ); %[output:81b446ad]
%%
%[text] %[text:anchor:H_5EEA42F6] ## Restore the original data.
%[text] The new chart data can also be longer than the existing data.
AC.Data = data; %[output:287a05ca]
%%
%[text] %[text:anchor:H_F40E9650] ## Restore the labels and legend text.
AC.LabelText = "Wedge " + (1:numel( data )); %[output:19f9dfc2]
AC.LegendText = string( 1:numel( data ) ); %[output:19f9dfc2]
%%
%[text] %[text:anchor:H_24F53125] ## Customize the wedge colors.
%[text] If the `FaceColor` property is not specified at the time of creation, then the chart is created using the `hsv` colormap. To change the color of the wedges, specify a new color array.
AC.FaceColor = bone( numel( AC.Data ) ); %[output:70fcf987]
%%
%[text] %[text:anchor:H_308ACA98] ## Explode the chart's wedges.
%[text] To explode the chart's wedges radially outward, invoke the **`explode`** method.
explode( AC ) %[output:8dead886]
%%
%[text] %[text:anchor:H_8D91303D] ## Retract the wedges.
%[text] We retract the wedges to their original positions by invoking the **`retract`** method.
retract( AC ) %[output:5dc2de0b]
%%
%[text] %[text:anchor:H_39D8BD8E] ## Hide the wedge labels.
%[text] The labels can be hidden completely.
AC.LabelVisible = "off"; %[output:6dcac05e]
%%
%[text] %[text:anchor:H_98737DEF] ## Further wedge label customization.
%[text] Let's restore the labels and make the font size slightly smaller.
set( AC, "LabelVisible", "on", "LabelFontSize", 8 ) %[output:46482384]
%%
%[text] %[text:anchor:H_02FC92AC] ## Further legend customization.
%[text] %[text:anchor:H_50311B4D] The chart provides several further properties for adjusting the legend's appearance.
set( AC, "LegendFontSize", 8, "LegendBox", "off" ) %[output:9f268254]
%%
%[text] %[text:anchor:H_DE5C938A] ## Specify a fixed view for the chart.
%[text] The `Annulus` chart has the `view` method for setting a specific view. For example, we can set the standard 2D view as follows.
view( AC, 2 ) %[output:75de70d1]
%%
%[text] %[text:anchor:H_8B03FE16] ## Restore the default view.
resetView( AC ) %[output:9c1e4428]
%%
%[text] %[text:anchor:H_8BABE06A] ## Enable the chart's control panel.
%[text] To show the chart's control panel, we set the `Controls` property to `"on"` or use the interactive control in the axes toolbar.
AC.Controls = "on"; %[output:4204208e]
%%
